import React from 'react';
import axios from 'axios';
import { NavLink, useNavigate } from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate();

    const logout = async (e) => {
        e.preventDefault();
        // const token = localStorage.getItem('token');
        try {
            const response = await axios.post('https://login-api.web2rise.in/api/logout');

            if (response) {
                localStorage.removeItem('token');
                navigate('/');
            }
        } catch (error) {
            console.error(error);
        }
    };

    return (
        <>
            <div classNameName='main_div'>
                <ul classNameName='child_div'>
                    <NavLink className='create_user' to="/CreateUser">
                        <li className='create_user1'>Create User</li>
                    </NavLink>
                    <NavLink className='create_user' to="/User">
                        <li className='create_user2'>User</li>
                    </NavLink>
                    <li onClick={logout} className='create_user'>
                        Logout
                    </li>
                </ul>
            </div>
        </>
    );
};

export default Home;
